import React from "react";
import style from "./Konstructor.module.css"

export const Konstructor=()=>{

    let arr=[
        {
            src:"https://eco-wood-art.by/wp-content/uploads/2022/08/22222-300x300.jpg",
            zagolovok:"Дикий кот",
            price:"89.00 BYN"
        },
        {
            src:"https://eco-wood-art.by/wp-content/uploads/2022/08/1111-300x300.jpg",
            zagolovok:"Черный кот",
            price:"89.00 BYN"
        },
        {
            src:"https://eco-wood-art.by/wp-content/uploads/2020/04/guarantee.svg",
            zagolovok:"ВЕТРЯНАЯ МЕЛЬНИЦА",
            price:"89.00 BYN"
        },
        {
            src:"https://eco-wood-art.by/wp-content/uploads/2020/04/guarantee.svg",
            zagolovok:"Самолет",
            price:"89.00 BYN"
        },

    ];

    let predlog=arr.map(item=><div className={style.wrap1}>
            <img className={style.image} src={item.src} alt=""/>
            <h2>{item.zagolovok}</h2>
        </div>
    );


    return(
        <div className={style.wrapper}>
            <div className={style.obertka}>
                {predlog}
            </div>
        </div>
    )
}
